import React, {Component} from 'react';
import './App.css';
import {getGryffindor} from './endpoints'

class App extends Component {

  componentDidMount() {
    fetch(getGryffindor)
      .then(resp => resp.json())
      .then(console.log)
  }

  render(){
    return (
      <div id="character-container">
      </div>
    )
  }
}

export default App;
